import React from "react";
import { Link } from "react-router";

function Navbar() {
	return (
		
                    <div className="navBar">
                        <img src="img/copy1.png" />
                        <div className="links">
                            <Link to="/">Home</Link>
								<Link to="/about">About</Link>
								<Link to="/shop">Shop</Link>
								<Link to="#">Cart</Link>
								<Link className="button" to="/signIn">
									Sign in
								</Link>
                        </div>
                    </div>
	);
}

export default Navbar;
